import axios from 'axios';
import {getInitialProps} from 'next';


const Index = (dados) => (
    <div>
        <h1>TESTE</h1>
    </div>
);

Index.getInitialProps = async () => {
    const response = await axios.get(
        'http://localhost:8080/'
    );
    console.log(response);
    return {dados : response};
};
export default Index;
